import React from 'react'
import { deleteTask, saveTask, getTask, updateTask, getTasks } from '../api/TaskService';
import { TaskInterface } from '../interface/TaskInterface';
import { Task } from './Task';

interface Props{
  work: boolean;
  completed: boolean;
  data: any;
}

const TaskList = async (props: Props) => {
  try{const { data } = await getTasks();}
  catch(error){console.log(error);}
  

  if(props.work){
    return (
      <>
        {props.data?.content?.length > 0 && props.data.map((currentTask: TaskInterface, key:any) => {
          if(!currentTask.taskCompleted){
            return <Task task={currentTask} key={key}/>
          }
        })};
      </>
    )
  }
  if(props.completed){
    return (
      <>
        {props.data?.content?.length > 0 && props.data.map((currentTask: TaskInterface, key:any) => {
          if(currentTask.taskCompleted){
            return <Task task={currentTask} key={key} />
          }
        })}
      </>
    )
  }
    return (
    <>
      {props.data?.content?.length > 0 && props.data.map((currentTask: TaskInterface, key:any) => {
        return(
          <Task task={currentTask} key={key} />
        ); 
      })}
    </>
  )}

export default TaskList
